import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Route, SwitchS } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route exact path='/' component={Welcome}/>
      </Switch>
    </div>
    </Router>
    
  );
}

export default App;
